import React from 'react';
import {NavLink} from 'react-router-dom';
const Nav = () => {
  return (
    <div className="navbar">
        <ul>
          <li><NavLink exact to='/'>Accueil</NavLink></li>
          <li><NavLink to ='/presentation'>presenation</NavLink></li>
        </ul>
    </div>
  )
}
export default Nav;
